package Loops;

public class Dowhileloop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String string="Testing";
		int a=20;
		do
		{
			System.out.println(a+" "+string);
			a=a+2;
		}while(a<=26);
		
		do
		{
			System.out.println(a+" "+string);
			a=a+5;
		}while(a<=25);

	}

}
